syntax = "proto3";

package sdc.biceps;

option java_multiple_files = true;
option java_package = "org.somda.sdc.proto.model.biceps";
option java_outer_classname = "SexProto";


message SexMsg {
  enum EnumType {
    UNSPEC = 0;
    M = 1;
    F = 2;
    UNKN = 3;
  }
  EnumType enum_value = 1;
}
